    false,nt"url": null,nt"notes": "Monthly tabulated index of the East Atlantic/
    Western Russia teleconnection pattern. The data spans the period 1950 to present.
    The index is derived from a rotated principal component analysis (RPCA) of normalized
    500-hPa height anomalies from the period 1950-2000. The data source is the NCEP/NCAR
    Reanalysis. The resulting time series is then re-normalized to coincide with the
    1981-2010 base period monthly means. The index is updated monthly. Calculating the
    index using the RPCA approach is a somewhat complicated process, in that it is not
    derived independently of the other extratropical teleconnection pattern indices.",nt"license_title":
